function DeleteUser() {
    const  { dataUser } = UseFetch('https://store-wbly.onrender.com/users');
    const array=[{
      name:"dina",
      age:12
    },
    {
      name:"dina",
      age:13
    },{
      name:"dina",
      age:14
    },
    {
      name:"dina",
      age:null
    }]
    console.log({dataUser})
    return (
        <>
   <div className="container">
      <div className="row">
            {array &&
                array.map((item) => (
                    <div className="col-12 col-sm-6 col-md-4 col-lg-3" key={item.age}>
                        <div className="our-team">
                            <div className="picture">
                                <img className="img-fluid" src={item.age}/>
                            </div>
                            <div className="team-content">
                                <h3 className="name">{item.name}</h3>
                                {/* <h4 className="title">email is ={item.email}</h4> */}
                            </div>
                            {/* <ul className="social">
                                {item.favorite && Array.isArray(item.favorite) && (
                                    item.favorite.map((favoriteItem, index) => (
                                        <li key={index}>
                                            <a href="https://codepen.io/collection/XdWJOQ/" className="fa fa-facebook" aria-hidden="true"></a>
                                        </li>
                                    ))
                                )}
                            </ul> */}
                        </div>
                    </div>
                ))}
        </div>
    </div> 
        </>
    );
}

export default DeleteUser;
